import React from 'react';
import './App.css';
import Navigation from './componments/Navigation/Navigation';
import Logo from './componments/Logo/Logo';
import ImageLinkForm from './componments/ImageLinkForm/ImageLinkForm';
import Rank from './componments/Rank/Rank';
import Particles from 'react-particles-js';
import { Component } from 'react';
import Clarifai from 'clarifai';
import FaceRecognition from './componments/FaceRecognition/FaceRecognition';


const particlesOptions = {
  particles: {
    number: {
      value: 100,
      density: {
        enable: true,
        value_area: 350
      }
    }
  }
}

const app = new Clarifai.App({
  apiKey: '1b2bc0835cbd40fa92081345abe6bef1'
});

class App extends Component {
  constructor(){
    super();
    this.state ={
      input: '',
      imgUrl: ''
    }
  }

  onInputChange = (event) => {
    console.log(event.target.value);
  }

  onButtonSubmit = () => {
    this.setState({imgUrl: this.state.input});
    app.models.predict(Clarifai.COLOR_MODEL, "https://samples.clarifai.com/face-det.jpg")
    .then(function (response) {
        console.log(response);
      },
      function (err) {
        // there was an error
      }
    );
  }

  render(){
    return (
      <div className="App">
        <Particles className='particles'
          params={particlesOptions} />
        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm  onInputChange={this.onInputChange} onButtonSubmit={this.onButtonSubmit}/>
        <FaceRecognition imgUrl={this.state.imgUrl}/>
      </div>
    );
  }
}

export default App;
